INSERT INTO `email_template_langs` (`id`, `parent_id`, `lang`, `subject`, `content`, `created_at`, `updated_at`) VALUES
(1, 1, 'ar', 'New User', '<p>,</p>\n                    <p>   { app_name }.</p>\n                    <p>..   </p>\n                    <p>  : { mail }   : { password }</p>\n                    <p>{ app_url }</p>\n                    <p></p>\n                    <p>{ app_name }</p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(2, 1, 'da', 'New User', '<p>Hej,</p>\n                    <p>velkommen til { app_name }.</p>\n                    <p>Du er nu bruger ..</p>\n                    <p>E-mail: { email }</p>\n                    <p>kodeord: { password }</p>\n                    <p>{ app_url }</p>\n                    <p>Tak.</p>\n                    <p>{ app_name }</p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(3, 1, 'de', 'New User', '<p>Hallo,</p>\n                    <p>Willkommen bei {app_name}.</p>\n                    <p>Sie sind jetzt Benutzer.</p>\n                    <p><strong>E-Mail: {email} </strong></p>\n                    <p><strong>Kennwort: {password}</strong></p>\n                    <p>{app_url}</p>\n                    <p>Danke,</p>\n                    <p>{app_name}</p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(4, 1, 'en', 'New User', '<p>Hello,&nbsp;<br />Welcome to {app_name}.</p>\n                    <p><strong>You are now user..</strong></p>\n                    <p><strong>Email </strong>: {email}<br /><strong>Password</strong> : {password}</p>\n                    <p>{app_url}</p>\n                    <p>Thanks,<br />{app_name}</p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(5, 1, 'es', 'New User', '<p>Hola,</p>\n                    <p>Bienvenido a {app_name}.</p>\n                    <p>Ahora es usuario ..</p>\n                    <p><strong>Correo electr&oacute;nico: {email}</strong></p>\n                    <p><strong> Contrase&ntilde;a: {password}</strong></p>\n                    <p>{app_url}</p>\n                    <p>Gracias,</p>\n                    <p>{app_name}</p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(6, 1, 'fr', 'New User', '<p>Bonjour,</p>\n                    <p>Bienvenue dans { app_name }.</p>\n                    <p>Vous &ecirc;tes maintenant utilisateur.</p>\n                    <p><strong>E-mail: { email } </strong></p>\n                    <p><strong>Mot de passe: { password }</strong></p>\n                    <p>{ adresse_url }</p>\n                    <p>Merci,</p>\n                    <p>{ nom_app }</p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(7, 1, 'it', 'New User', '<p>Ciao,</p>\n                    <p>Benvenuti in {app_name}.</p>\n                    <p>Ora sei utente ..</p>\n                    <p><strong>Email: {email} </strong></p>\n                    <p><strong>Password: {password}</strong></p>\n                    <p>{app_url}</p>\n                    <p>Grazie,</p>\n                    <p>{app_name}</p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(8, 1, 'ja', 'New User', '<p></p>\n                    <p>{app_name}</p>\n                    <p></p>\n                    <p><strong>E  : {email}</strong></p>\n                    <p><strong>  : {password}</strong></p>\n                    <p>{app_url}</p>\n                    <p></p>\n                    <p>{app_name}</p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(9, 1, 'nl', 'New User', '<p>Hallo,</p>\n                    <p>Welkom bij { app_name }.</p>\n                    <p>U bent nu gebruiker ..</p>\n                    <p><strong>E-mail: { email }</strong></p>\n                    <p><strong> Wachtwoord: { password }</strong></p>\n                    <p>{ app_url }</p>\n                    <p>Bedankt.</p>\n                    <p>{ app_name }</p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(10, 1, 'pl', 'New User', '<p>Witaj,</p>\n                    <p>Witamy w aplikacji {app_name }.</p>\n                    <p>Jeste teraz uytkownikiem ..</p>\n                    <p><strong>E-mail</strong>: {email }</p>\n                    <p><strong>Haso</strong>: {password }</p>\n                    <p>{app_url }</p>\n                    <p>Dzikuj,</p>\n                    <p>{app_name }</p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(11, 1, 'ru', 'New User', '<p>,</p>\n                    <p>   { app_name }.</p>\n                    <p>   ..</p>\n                    <p><strong>  </strong>: { email }</p>\n                    <p><strong> </strong>: { password }</p>\n                    <p>{ app_url }</p>\n                    <p>.</p>\n                    <p>{ app_name&nbsp;}</p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(12, 1, 'pt', 'New User', '<p style=\"font-size: 14.4px;\"><span style=\"font-size: 14.4px;\">Ol&aacute;, </span></p>\n                    <p style=\"font-size: 14.4px;\"><span style=\"font-size: 14.4px;\">Bem-vindo a {app_name}.</span></p>\n                    <p style=\"font-size: 14.4px;\"><span style=\"font-size: 14.4px;\">Voc&ecirc; agora &eacute; usu&aacute;rio ..</span></p>\n                    <p style=\"font-size: 14.4px;\"><span style=\"font-size: 14.4px;\"><strong>E-mail</strong>: {email}</span></p>\n                    <p style=\"font-size: 14.4px;\"><span style=\"font-size: 14.4px;\"><strong> Senha</strong>: {senha}</span></p>\n                    <p style=\"font-size: 14.4px;\"><span style=\"font-size: 14.4px;\">{app_url}</span></p>\n                    <p style=\"font-size: 14.4px;\"><span style=\"font-size: 14.4px;\">Obrigado,</span></p>\n                    <p style=\"font-size: 14.4px;\"><span style=\"font-size: 14.4px;\">{app_name}</span></p>', '2022-11-23 09:03:25', '2022-11-23 09:03:25'),
(13, 2, 'ar', 'New Employee', '<p> { employe_name } </p>\n                    <p>   { app_name }.</p>\n                    <p>  </p>\n                    <p>  : { employe_email }</p>\n                    <p>  : { employe_password }</p>\n                    <p>{ app_url }</p>\n                    <p></p>\n                    <p>{ app_name }</p>', '2022-11-23 09:03:26', '2022-11-23 09:03:26'),
(14, 2, 'da', 'New Employee', '<p>Hej { employee_name },</p>\n                    <p>velkommen til { app_name }.</p>\n                    <p>Du er nu ansat ...</p>\n                    <p>E-mail: { employee_email }</p>\n                    <p>Kodeord: { employee_kodeord }</p>\n                    <p>{ app_url }</p>\n                    <p>Tak.</p>\n                    <p>{ app_name }</p>', '2022-11-23 09:03:26', '2022-11-23 09:03:26'),
